-- 2. Cree una consulta en SQL que muestre todas las facturas con sus respectivos
-- detalles. La información debe incluir el número de factura, fecha de emisión,
-- cliente asociado (nombre completo), empleado asociado (nombre completo), total
-- a pagar, estado de la factura, y los productos adquiridos con sus cantidades y precios.
SELECT 
  fe.NumFactura AS 'NumeroFactura',
  fe.FecCompra AS 'FechaEmision',
  CONCAT(c.Nombre, ' ', c.Apellido1, ' ', c.Apellido2) AS 'Cliente',
  CONCAT(e.Nombre, ' ', e.Apellido1, ' ', e.Apellido2) AS 'Empleado',
  fe.Total AS 'TotalPagar',
  CASE
    WHEN fe.Estado = 0 THEN 'Pendiente'
    WHEN fe.Estado = 1 THEN 'Pagada'
    ELSE 'Desconocido'
  END AS 'EstadoFactura',
  fp.CodProducto AS 'CodigoProducto',
  p.Descripcion AS 'Producto',
  fp.Cantidad AS 'Cantidad',
  fp.PrecioUnitario AS 'PrecioUnitario',
  (fp.Cantidad * fp.PrecioUnitario) AS 'SubTotal'
FROM ELEFacturaEnc fe
JOIN ELEClientes c ON fe.CodCliente = c.CodCliente
JOIN ELEEmpleados e ON fe.CodEmpleado = e.CodEmpleado
JOIN ELEFacturasDet fp ON fe.NumFactura = fp.NumFactura
JOIN ELEProductos p ON fp.CodProducto = p.CodProducto;
-- 3. Genere una consulta en SQL que indique el total de ventas por tienda, mostrando
-- el nombre de la tienda, total de ventas (suma de los totales a pagar) y el número de facturas emitidas.SELECT 
  t.Nombre AS 'NombreTienda',
  SUM(fe.Total) AS 'TotalVentas',
  COUNT(fe.NumFactura) AS 'NumFacturas'
FROM ELETiendas t
JOIN ELEFacturaEnc fe ON t.CodTienda = fe.CodTienda
GROUP BY t.Nombre;

-- 4. Cree una consulta en SQL que muestre el nombre de los clientes, la cantidad de
-- compras que han realizado y el total pagado por esas compras, para aquellos
-- clientes que han realizado más de dos compras. La información debe incluir el
-- número de identificación del cliente, nombre completo del cliente, la cantidad de
-- compras y el total pagado.SELECT 
    c.Identificacion AS NumIdentificacion,
    CONCAT(c.Nombre, ' ', c.Apellido1, ' ', c.Apellido2) AS NombreCompleto,
    COUNT(fe.NumFactura) AS CantidadCompras,
    SUM(fe.Total) AS TotalPagado
FROM 
    ELEClientes c
JOIN 
    ELEFacturaEnc fe ON c.CodCliente = fe.CodCliente
GROUP BY 
    c.Identificacion, c.Nombre, c.Apellido1, c.Apellido2
HAVING 
    COUNT(fe.NumFactura) > 2;

-- 5. Cree un comando en SQL que actualice la fecha estimada de entrega de los
-- productos a tres días adicionales a la fecha que tienen en la actualidad. Por
-- ejemplo, si en la actualidad tienen como fecha estimada de entrega el 15-09-2024,
-- una vez actualizada debe quedar el 18-09-2024. Solo deben actualizarse las
-- fechas de entrega para aquellos productos cuya diferencia entre la fecha de
-- entrega y la fecha de emisión sea menor a cuatro días.
UPDATE ELEFacturaEnc
SET FecEntrega = DATEADD(day, 3, FecEntrega)
WHERE DATEDIFF(day, FecCompra, FecEntrega) < 4;

